def reconstruct_string_from_genome_path(genome_path):
    # Extract the first k-1 symbols of the first k-mer
    reconstructed_text = genome_path[0]

    # Append the remaining symbols of each k-mer to the string
    for i in range(1, len(genome_path)):
        reconstructed_text += genome_path[i][-1]

    return reconstructed_text

